      <form className="form">
        <label className="label">Username:</label>
        <input 
          value={username} 
          className="input"
        />
        <label className="label">Password:</label>
        <input 
          value={password} 
          className="input"
        />
        <button className="button">Login</button>
      </form>
    </div>
    </div>
  );
}

export default App;
